import React from 'react';
import Moment from "react-moment";

const TimelineCardHeader = (props) => {
  return (
      <div style={{textAlign: 'center'}}>
        <p style={{display: 'inline',  marginRight: '15px'}}>
          <i className="fas fa-calendar-week" style={{marginRight: '3px'}}/><Moment format="DD/MM/YYYY">{props.compra.timestamp}</Moment>
        </p>
        <p style={{display: 'inline', marginRight: '15px'}}>
          <i className="far fa-clock" style={{marginRight: '3px'}}/><Moment format="HH:mm">{props.compra.timestamp}</Moment>
        </p>
        <p style={{display: 'inline', marginRight: '15px'}}>
          <i className="fas fa-map-marker-alt" style={{marginRight: '3px'}}/>
          {
            props.compra.custom_data.map(data => { if (data.key === 'store_name') return data.value })
          }
        </p>
        <p style={{display: 'inline', marginRight: '15px'}}>
          <i className="fas fa-dollar-sign" style={{marginRight: '3px'}}/>{props.compra.revenue.toFixed(2)}
        </p>
      </div>
  );
};


export default TimelineCardHeader;
